import React from 'react'
import {useState} from 'react';


function ShowAllData(Data) {
    const [infoD,setInfoD]=useState([]);
    const info={Data};
    console.log(info);
    if(info)
    {
       setInfoD(info);
    }
  return (
    <>
    <table>
        <thead>
            <td>Name</td>
            <td>Enrollment no.</td>
            <td>Class</td>
        </thead>
        <tbody>
            {
                infoD.map((current,index)=>{
                    return(<>
                      <tr key={index}>
                    <td>{current.userName}</td>
                    <td>{current.userEnrollment}</td>
                    <td>{current.userClass}</td>
                </tr>
                    </>)
                })
                
            }
        </tbody>
    </table>
    </>
  )
}

export default ShowAllData
